function parseCodecToFileExtension(codecName){
    const codecDictionary = new Map([
        ['hevc','hevc'],
        ['aac:LC', 'aac'],
        ['ac3', 'ac3'],
        ['eac3', 'eac3'],
        ['truehd', 'thd'],
        ['dts:DTS-HD MA', 'dts'],
        ['dts:DTS-HD', 'dts'],
        ['dts:DTS', 'dts'],
        ['opus', 'opus'],
        ['flac', 'flac'],
        ['pcm_s24le', 'wav'],
        ['pcm_s16le', 'wav'],
        ["subrip", "srt"],
        ["mov_text", "txt"]
    ]);
    return codecDictionary.get(codecName) ?? "";
}

function parseCodecToCodecName(codecName){
    const codecDictionary = new Map([
        ['aac:LC', 'AAC'],
        ['ac3', 'Dolby Digital'],
        ['eac3', 'Dolby Digital+'],
        ['truehd', 'Dolby TrueHD'],
        ['dts:DTS-HD MA', 'DTS-HD Master Audio'],
        ['dts:DTS-HD', 'DTS-HD'],
        ['dts:DTS', 'DTS'],
        ['opus', 'Opus'],
        ['flac', 'Flac'],
        ['pcm_s24le', 'WAV 24-Bit'],
        ['pcm_s16le', 'WAV 16-Bit'],
        ['hdmv_pgs_subtitle', 'HDMV PGS'],
        ['subrip', 'Subrip'],
        ['mov_text', 'MovText'],
        ['dvd_subtitle', 'VobSub'],
        ['ass', 'SubStation Alpha']
    ]);
    return codecDictionary.get(codecName) ?? "";
}

function getModifiedActionValue(action,property, noFallback = false){
    if (action.hasOwnProperty(2) && action[2].has(property)){
        return action[2].get(property);
    }
    if (!noFallback){
        return action[1].get(property);
    }
    return null;
}

// userSetting should be where 0 = worst and 100 equal best, otherwise invertUserSetting must be used.
calculateTranscodingTuneSetting = (userSetting, lowestQualityValue, highestQualityValue, invertUserSetting = false) => {
    if (invertUserSetting) userSetting = 100 - userSetting;
    const newUserTuneSetting = ((userSetting - 0) * (highestQualityValue - lowestQualityValue)) / 100 + lowestQualityValue;
    return lowestQualityValue < highestQualityValue ? Math.ceil(newUserTuneSetting) : Math.floor(newUserTuneSetting);
}

