class Muxing {
    static actionsEnum = Object.freeze({
        EXTRACT:  "EXTRACT",
        CREATE:   "CREATE",
        MODIFY:   "MODIFY",
        REWRITE:  "REWRITE",
        COPY:     "COPY",
        COPYDOVI: "COPYDOVI",
        DISCARD:  "DISCARD"
    });
    static formatAction = (globalStreamId,type,typeStreamId,currentStreamCodec,currentStreamLanguage,currentStreamBitRate,title,defaultStream,formats) => {
        return new Map([
            ['globalStreamId', globalStreamId],
            ['type', type],
            ['typeStreamId', typeStreamId],
            ['codec', currentStreamCodec],
            ['bitrate', Number(currentStreamBitRate)],
            ['language', currentStreamLanguage],
            ['title',title],
            ['default', defaultStream],
            ['formats', formats]
        ]);
    }
}

class NodeJSSubtitleReWriter{
    programPath = "";
    savePath = "";
    originalFile = null;
    fileActions = [];
    extractorInterface = null

    constructor(pathVars, extractorInterface, originalFile,savePath) {
        this.programPath = `${pathVars.get("node")} ${pathVars.get("script")}`;
        this.extractorInterface = extractorInterface;
        this.originalFile = originalFile;
        this.savePath = savePath;
    }

    loadActions(actions){
        const toLoadActions = [];
        actions.forEach((action, index) => {
            const [actionType, actionData, actionModifications] = action;
            if (![Muxing.actionsEnum.REWRITE].includes(actionType)) return;
            toLoadActions[index] = action;
        })
        this.fileActions = toLoadActions;
        return actions;
    }

    processActions(){
        return this.fileActions.map(action => {
            return action ? this.executeAction(action) : action;
        })
    }

    detectLanguageOfCurrentFile(action, isSourceFileSrt = false){
        let targetFile = "";
        if (isSourceFileSrt){
            targetFile = this.originalFile.get("complete");
        } else{
            let extractionPreset = "";
            [extractionPreset, targetFile] = this.extractorInterface.executeAction(action, `${os.tmpdir().replaceAll("\\","/")}/`).get("preset")();
            execSync(extractionPreset);
        }
        const subtitleFileCharset = jschardet.detect(fs.readFileSync(targetFile));
        if (!subtitleFileCharset || !subtitleFileCharset.encoding) throw "No charset could be found for subtitle file";
        const subtitleFileContents = fs.readFileSync(targetFile, subtitleFileCharset.encoding).split(/\r?\n/).filter((line) => isNaN(Number(line.charAt(0))) && line !== "").join(" ");
        const subtitleDetectedLanguage = languageDetect.detect(subtitleFileContents,1)[0][0] ?? "Undefined";
        const language2LetterIsoCode = Array.from(getLanguageDictionary().values()).find((language) => language[1].toLowerCase() === subtitleDetectedLanguage)?.[0];
        return [subtitleFileCharset.encoding, language2LetterIsoCode];
    }

    executeAction(action){
        const isSourceFileSrt = this.originalFile.get("extension").toLowerCase() === "srt";
        const newFileExtension = parseCodecToFileExtension(action[1].get("codec"));
        let baseOriginalFileName = `${this.originalFile.get("baseName")}.`;
        let originalFilePath = this.originalFile.get("complete");
        const preparePresets = [];
        if(isSourceFileSrt){
            Array.from(getLanguageDictionary().values()).forEach(language => {
                baseOriginalFileName = baseOriginalFileName.replace(`.${language[0]}.`,".");
            });
        } else{
            const [extractionPreset, targetFile] = this.extractorInterface.executeAction(action).get("preset")();
            preparePresets.push(extractionPreset);
            originalFilePath = targetFile;
        }
        const [detectedSubtitleCharset, detected2LetterLanguageIso] = this.detectLanguageOfCurrentFile(action, isSourceFileSrt);
        let newFileName = `${baseOriginalFileName}${action[1].get("formats").includes("forced") ? "forced." : ""}${detected2LetterLanguageIso}.${newFileExtension}`;
        const exportFile = `${this.savePath.replace("\\","/")}${newFileName}`;
        return new Map([
            ["action", action],
            ["preset", () => {
                const rewriteSubtitlePreset = `${this.programPath} -i "${originalFilePath}" -ie "${detectedSubtitleCharset}" -o "${exportFile}"`;
                return [preparePresets.length > 0 ? [...preparePresets, rewriteSubtitlePreset] : rewriteSubtitlePreset, exportFile]
            }],
        ]);
    }
}

