class FFMpegTranscoder{
    programPath = "";
    customFFmpegInstalls = [];
    savePath = "";
    originalFile = null;
    fileActions = [];
    ffmpegOnlyMode = false;
    installedGPUPlatform = null;
    preferredEncodingSpeed = 0;
    universalVideoQuality = 100;

    decodeableCodecs = new Map([
        ["h264", true],
        ["hevc", true],
        ["mpeg4", true],
        ["mpeg2video", true],
        ["vc1", true],
        ["av1", true],
        ["dts:DTS-HD MA", true],
        ["dts:DTS-HD", true],
        ["dts:DTS", true],
        ["truehd", false],
        ["eac3", true],
        ["ac3", true],
        ["aac:LC", true],
        ["opus", true],
        ["flac", true],
        ['pcm_s24le', true],
        ['pcm_s16le', true],
        ["mov_text", true],
        ["subrip", true],
        ["hdmv_pgs_subtitle", false],
        ["dvd_subtitle", false],
    ])

    encodeableCodecs = new Map ([
        ["h264", true],
        ["hevc", true],
        ["mpeg4", true],
        ["mpeg2video", true],
        ["vc1", false],
        ["av1", true],
        ["dts:DTS-HD MA", false],
        ["dts:DTS-HD", false],
        ["dts:DTS", false],
        ["truehd", false],
        ["eac3", false],
        ["ac3", true],
        ["aac:LC", true],
        ["opus", true],
        ["flac", true],
        ['pcm_s24le', true],
        ['pcm_s16le', true],
        ["mov_text", true],
        ["subrip", true],
        ["hdmv_pgs_subtitle", false],
        ["dvd_subtitle", false],
    ])

    exportToRawHevc(action){
        "ffmpeg -i input.mkv -c:v copy -bsf:v hevc_mp4toannexb -f hevc -"
    }


    constructor(pathVars,originalFile,savePath,inputs) {
        this.programPath = pathVars.get("ffmpeg");
        this.originalFile = originalFile;
        this.savePath = savePath;
        this.installedGPUPlatform = inputs.installedGPUPlatform;
        this.preferredEncodingSpeed = inputs.preferredEncodingSpeed;
        this.universalVideoQuality = inputs.universalVideoQuality;

        if(pathVars.has("ffmpegfdk")){
            this.customFFmpegInstalls.push(
                new Map([
                    ["applyToCodec", "aac:LC"],
                    ["customPreset", (mappedStreamId, audioStreamId, bitrate, channels, exportFile) => [`${pathVars.get("ffmpegfdk")} -i "${this.originalFile.get("complete")}" -vn -map 0:a:${audioStreamId} -c:a libfdk_aac ${bitrate && `-b:a:0 ${bitrate / 1000}k`} -ac:a ${channels} -filter:a "volume=2" "${exportFile}"`, exportFile]],
                    ["decodeableCodecs", new Map([...Array.from(this.decodeableCodecs.entries())])],
                    ["encodeableCodecs", new Map([...Array.from(this.encodeableCodecs.entries()), ["aac:LC", true]])]
                ])
            )
        }
    }

    setFFMpegOnlyMode(ffMpegOnlyMode){
        this.ffmpegOnlyMode = ffMpegOnlyMode;
    }

    loadActions(actions){
        const toLoadActions = [];
        actions.forEach((action, index) => {
            const [actionType, actionData, actionModifications] = action;
            if (![Muxing.actionsEnum.CREATE,Muxing.actionsEnum.MODIFY].includes(actionType)) return;
            const decodingCodec = this.decodeableCodecs.get(actionData.get("codec"));
            let encodingCodec = this.encodeableCodecs.get(actionData.get("codec"));
            if (actionModifications.has("codec")){
                encodingCodec = this.encodeableCodecs.get(actionModifications.get("codec"));
            }

            let error = [];
            if(decodingCodec === undefined) error.push(`Failed to load action, failed to determine decoder support for codec: ${decodingCodec}`);
            if(decodingCodec === false) error.push(`Failed to load action, FFMpeg has no decoder for codec: ${decodingCodec}`);
            if(encodingCodec === undefined) error.push(`Failed to load action, failed to determine encoder support for codec: ${encodingCodec}`);
            if(encodingCodec === false) error.push(`Failed to load action, FFMpeg has no encoder for codec: ${decodingCodec}`);
            if (error.length > 0) throw error.join(" ");
            toLoadActions[index] = action;
        })
        this.fileActions = toLoadActions;
    }

    processActions(){
        return this.fileActions.map(action => {
            return this.executeAction(action);
        })
    }

    generateToH265PresetGPUPlatform(action){
        const newActionFormats = getModifiedActionValue(action,"formats", true);
        const newPixelFormat = newActionFormats && newActionFormats[0][0].includes("10le") ? "p010le" : null;
        const pixelFormatPresetPart = `${newPixelFormat && `-pix_fmt ${newPixelFormat}`}`;
        const gpuPlatformsEnum = getGPUPlatforms();
        switch (this.installedGPUPlatform){
            case gpuPlatformsEnum.NVIDIARTX:
                const presetTuneSetting = calculateTranscodingTuneSetting(this.preferredEncodingSpeed, 1, 7, true)
                const cqTuneSetting = calculateTranscodingTuneSetting(this.universalVideoQuality, 51, 1)
                return `hevc_nvenc ${pixelFormatPresetPart} -rc vbr -tune hq -preset p${presetTuneSetting} -cq ${cqTuneSetting}`;
                // Tried -tune -uhq (Ultra high quality), No huge quality improvement while 8x to 2x decrease in encoding speed on RTX 3080 Ti.
                break;
            case gpuPlatformsEnum.INTELARC:
                // Preset still untested
                const qvbrTuneSetting = calculateTranscodingTuneSetting(this.universalVideoQuality, 51, 1);
                return `hevc_qsv ${pixelFormatPresetPart} -qvbr ${qvbrTuneSetting} -preset quality`
                break;
            case gpuPlatformsEnum.AMDRX:
                // Preset still untested
                const qpTuneSetting = calculateTranscodingTuneSetting(this.universalVideoQuality, 51, 0);
                return `hevc_amf ${pixelFormatPresetPart} -b:v 0 -qp ${qpTuneSetting} -preset quality`
                break;
            case gpuPlatformsEnum.APPLESILICON:
                // Preset still untested
                const qTuneSetting = calculateTranscodingTuneSetting(this.universalVideoQuality, 1, 100);
                return `hevc_videotoolbox ${pixelFormatPresetPart} -b:v 0 -q:v ${qTuneSetting} -preset slow`
                break;
            case gpuPlatformsEnum.NONE:
            default:
                const crfTuneSetting = calculateTranscodingTuneSetting(this.universalVideoQuality, 51, 1);
                return `libx265 ${newActionFormats && newActionFormats[0][0]} -crf ${crfTuneSetting} -preset slow`
        }
    }

    executeAction(action){
        const newFileExtension = parseCodecToFileExtension(getModifiedActionValue(action,"codec"))
        const newFileName = `${this.originalFile.get("baseName")}.${action[1].get("language")}.${action[1].get("typeStreamId")}.${newFileExtension}`;
        let exportFile = `${this.savePath}${newFileName}`;
        let preset = ``;
        const ffmpegOnlyModeDisabled = this.ffmpegOnlyMode ? "" : true;

        switch (action[1].get("type")){
            case "v":
                preset = (mappedStreamId = 0) => [
                    `${ffmpegOnlyModeDisabled && `${this.programPath} -i "${this.originalFile.get("complete")}" -an `} -map 0:v:${action[1].get("typeStreamId")} -c:v:${mappedStreamId} ${this.generateToH265PresetGPUPlatform(action)} ${ffmpegOnlyModeDisabled && ` -strict unofficial "${exportFile}"`}`,
                    this.ffmpegOnlyMode ? null : exportFile
                ];
                break
            case "a":
                const newActionCodec = getModifiedActionValue(action,"codec");
                let newActionBitrate = getModifiedActionValue(action, "bitrate", true);
                const newActionChannels = getModifiedActionValue(action,"formats")[0];
                const potentialCustomPreset = this.customFFmpegInstalls.find(install => install.get("applyToCodec") === newActionCodec && install.get("decodeableCodecs").get(newActionCodec) && install.get("encodeableCodecs").get(newActionCodec));
                const newActionStreamId = action[1].get("typeStreamId");
                if (potentialCustomPreset){
                    const customPresetGenerator = potentialCustomPreset.get("customPreset");
                    preset = (mappedStreamId = 0) => customPresetGenerator(mappedStreamId, newActionStreamId, newActionBitrate, newActionChannels, exportFile);
                } else{
                    preset = (mappedStreamId = 0) => {
                        const newMappedStreamId = ffmpegOnlyModeDisabled ? 0 : mappedStreamId;
                        let additionalFFmpegSettings = "";
                        const targetCodec = getModifiedActionValue(action,"codec",false);
                        if(targetCodec === "flac"){
                            newActionBitrate = null;
                            additionalFFmpegSettings = "-compression_level 12";
                        }

                        const audioPresetParts = [];
                        if(ffmpegOnlyModeDisabled) audioPresetParts.push(`${this.programPath} -i "${this.originalFile.get("complete")}" -vn`);
                        audioPresetParts.push(`-map 0:a:${newActionStreamId}`);
                        audioPresetParts.push(`-c:a:${newMappedStreamId} ${newActionCodec.split(":")[0]}`);
                        if(newActionBitrate) audioPresetParts.push(`-b:a:${newMappedStreamId} ${newActionBitrate / 1000}k`);
                        audioPresetParts.push(`-ac:a:${newMappedStreamId} ${newActionChannels}`);
                        if(additionalFFmpegSettings) audioPresetParts.push(additionalFFmpegSettings);
                        if(ffmpegOnlyModeDisabled) audioPresetParts.push(`-strict unofficial -y "${exportFile}"`);

                        return [
                            audioPresetParts.join(" "),
                            this.ffmpegOnlyMode ? null : exportFile
                        ]
                    };
                }
                break;
            case "s":
                preset = (mappedStreamId = 0) => {
                    const newMappedStreamId = ffmpegOnlyModeDisabled ? 0 : mappedStreamId;

                    const subtitlePresetParts = [];
                    if(ffmpegOnlyModeDisabled) subtitlePresetParts.push(`${this.programPath} -i "${this.originalFile.get("complete")}" -sn`);
                    subtitlePresetParts.push(`-map 0:s:${action[1].get("typeStreamId")}`);
                    subtitlePresetParts.push(`-c:s:${newMappedStreamId} ${getModifiedActionValue(action,"codec")}`);
                    if(ffmpegOnlyModeDisabled) subtitlePresetParts.push(`-strict unofficial -y "${exportFile}"`);

                    return [
                        subtitlePresetParts.join(" "),
                        this.ffmpegOnlyMode ? null : exportFile
                    ];
                }
                break;
            default:
                break;
        }
        return new Map([
            ["action", action],
            ["preset", preset],
        ]);
    }
}

