class FFMpegPresetGenerator {
    programPath = "";
    extractorInterface = null;
    transcoderInterface = null;
    doviMuxerInterface = null;
    subtitleRewriterInterface = null;
    fileMetaData = null;
    fileActions = [];

    containerCodecs = new Map([
        ['mkv', new Map([
            ["h264", true],
            ["hevc", true],
            ["mpeg4", true],
            ["vc1", true],
            ["av1", true],
            ["dts:DTS-HD MA", true],
            ["dts:DTS-HD", true],
            ["dts:DTS", true],
            ["truehd", true],
            ["eac3", true],
            ["ac3", true],
            ["aac:LC", true],
            ["opus", true],
            ["flac", true],
            ['pcm_s24le', true],
            ['pcm_s16le', true],
            ["mov_text", false],
            ["subrip", true],
            ["hdmv_pgs_subtitle", true],
            ["dvd_subtitle", true],
        ])]
    ]);

    constructor(pathVars, extractorInterface, transcoderInterface, doviMuxerInterface, subtitleRewriterInterface) {
        this.programPath = pathVars.get("ffmpeg");
        this.extractorInterface = extractorInterface;
        this.transcoderInterface = transcoderInterface;
        this.doviMuxerInterface = doviMuxerInterface;
        this.subtitleRewriterInterface = subtitleRewriterInterface;
    }

    loadFileMetaData(fileMetaData){
        this.fileMetaData = fileMetaData;
    };

    loadActions(actions){
        const currentContainerSupportedCodecs = this.containerCodecs.get(this.fileMetaData.get("targetContainerType"));
        actions = actions.map((action, index) => {
            const [actionType, actionData, actionModifications] = action;
            if ([Muxing.actionsEnum.DISCARD].includes(actionType)) return action;
            const originalCodec = action[1].get("codec");
            const targetCodec = getModifiedActionValue(action,"codec");
            const isTargetCodecSupported = currentContainerSupportedCodecs.get(targetCodec);

            if(isTargetCodecSupported === undefined) throw `No definition for codec ${targetCodec} in target container`;
            if(isTargetCodecSupported === false){
                if([Muxing.actionsEnum.COPY].includes(actionType)){
                    action[0] = Muxing.actionsEnum.EXTRACT;
                }
                if([Muxing.actionsEnum.MODIFY].includes(actionType)){
                    if(currentContainerSupportedCodecs.get(originalCodec)){
                        action[0] = Muxing.actionsEnum.COPY;
                    }else{
                        action[0] = Muxing.actionsEnum.DISCARD;
                    }
                }
                if ([Muxing.actionsEnum.CREATE].includes(actionType)){
                    action[0] = Muxing.actionsEnum.DISCARD;
                }
            }
            return action;
        })
        console.log(actions);
        this.fileActions = actions;
    };

    processCopyActions(){
        const copyPresetActions = [];
        this.fileActions.forEach((copyAction, index) => {
            if (copyAction[0] !== Muxing.actionsEnum.COPY) return;
            let preset = null;
            switch (this.fileMetaData.get("presetProgram")) {
                case ".mkv.mkv":
                    preset = (mappedStreamId = 0) => [
                        `-map 0:${copyAction[1].get("type")}:${copyAction[1].get("typeStreamId")} -c:${copyAction[1].get("type")}:${mappedStreamId} copy`,
                        null
                    ];
                    break;
                case ".mp4.mkv":
                    [copyAction, preset] = this.extractorInterface.executeAction(copyAction);
                    break;
                default:
                    throw "No program found for current and target container type";
            }
            copyPresetActions[index] = new Map([
                ["action", copyAction],
                ["preset", preset],
            ]);
        });
        return copyPresetActions;
    }

    generatePresets(){
        if (!this.fileActions || !this.fileMetaData) return;

        this.doviMuxerInterface.loadActions(this.fileActions);
        this.transcoderInterface.loadActions(this.fileActions);
        this.extractorInterface.loadActions(this.fileActions);
        this.subtitleRewriterInterface.loadActions(this.fileActions);

        let processedActionsData = [];
        this.processCopyActions().forEach((action, index) => action ? processedActionsData[index] = action : null);
        this.doviMuxerInterface.processActions().forEach((action, index) => action ? processedActionsData[index] = action : null);
        this.transcoderInterface.processActions().forEach((action, index) => action ? processedActionsData[index] = action : null);
        this.extractorInterface.processActions().forEach((action, index) => action ? processedActionsData[index] = action : null);
        this.subtitleRewriterInterface.processActions().forEach((action, index) => action ? processedActionsData[index] = action : null);

        let childPresets = [];
        let mainPreset = "";
        switch (this.fileMetaData.get("presetProgram")){
            case ".mkv.mkv":
                const programPath = this.programPath;
                let externalFiles = [this.fileMetaData.get("originalFile").get("complete")];
                const getMappedExternalFileId = () => externalFiles.length - 1;
                let containerPresetParts = [];

                let mappedIds = new Map([
                    ["v", -1],
                    ["a", -1],
                    ["s", -1]
                ]);
                processedActionsData.forEach(rawAction => {
                    const presetAction = rawAction.get("action");
                    const presetActionDetails = presetAction[1];
                    const presetActionModifications = presetAction[2];
                    const presetActionRawPreset = rawAction.get("preset");
                    const currentPresetActionType = presetActionDetails.get("type");

                    mappedIds.set(currentPresetActionType, mappedIds.get(currentPresetActionType) + 1);
                    const [presetActionPreset, presetActionPresetFile] = presetActionRawPreset(mappedIds.get(currentPresetActionType));
                    const newActionTitle = getModifiedActionValue(presetAction,"title");
                    const dispositionValue = getModifiedActionValue(presetAction, "formats").includes("forced") ? "forced" : (getModifiedActionValue(presetAction,"default") ? "default" : 0);
                    const metaDataPresetPart = `-disposition:${currentPresetActionType}:${mappedIds.get(currentPresetActionType)} ${dispositionValue} ${newActionTitle && `-metadata:s:${currentPresetActionType}:${mappedIds.get(currentPresetActionType)} title="${newActionTitle}"`} -metadata:s:${currentPresetActionType}:${mappedIds.get(currentPresetActionType)} language=${presetActionDetails.get("language")}`;
                    if (presetActionPresetFile !== null){
                        if (Array.isArray(presetActionPreset)){
                            presetActionPreset.forEach(presetPart => childPresets.push(presetPart));
                        } else{
                            childPresets.push(presetActionPreset);
                        }
                        externalFiles.push(presetActionPresetFile);
                        containerPresetParts.push(`-map ${getMappedExternalFileId()}:${currentPresetActionType}:0 -c:${currentPresetActionType}:${mappedIds.get(currentPresetActionType)} copy ${metaDataPresetPart}`);
                    } else{
                        containerPresetParts.push(`${presetActionPreset} ${metaDataPresetPart}`);
                    }
                });

                const fileTitle = this.fileMetaData.get("fileTitle");
                // const originalFile = this.fileMetaData.get("originalFile");
                // const newFileName = `${originalFile.get("directory")}${originalFile.get("baseName")}-transcoded.${originalFile.get("extension")}`;
                //"${newFileName}"
                mainPreset = `, ${externalFiles.slice(1).map(externalFile => `-i "${externalFile}"`).join(" ")} ${fileTitle ? `-metadata title="${fileTitle} " ` : ""}-map_chapters -1 ${containerPresetParts.join(" ")} -strict unofficial -y `;
                break;
            case ".mp4.mkv":

                break;
            default:
                throw "No program found for current and target container type";
        }

        return [...childPresets, mainPreset];
    }
}

function rewriteSubtitleContent(fs, filePath, newFilePath, inputFileEncodingType = "UTF-8"){
    const debugModeEnabled = true;
    const bannedSubtitleWords = [
        "https://", "opensubtitles", "bewerkt door", "translation by", "vertaling:", "translation:", ".com/",
    ];

    const sequences = [];

    let sequenceNumberFound = false;
    let sequenceTiming = "";
    let sequenceCaptions = [];
    fs.readFileSync(filePath, inputFileEncodingType).split(/\r?\n/).forEach((line, index) => {
        line = line.trim();
        if (!sequenceNumberFound && !Number.isNaN(parseInt(line))) {
            sequenceNumberFound = true;
            return;
        }
        if (sequenceNumberFound && sequenceTiming === ""){
            sequenceTiming = line;
            return;
        }
        if (sequenceTiming !== "" && line !== "")
        {
            sequenceCaptions.push([line, bannedSubtitleWords.some(bannedSubtitleWord => line.includes(bannedSubtitleWord))]);
            return;
        }
        if (line === ""){
            if(sequenceCaptions.some(filteredSequenceCaption => filteredSequenceCaption[1]) === false){
                const filteredSequenceCaptions = sequenceCaptions.map(caption => {
                    let line = caption[0];
                    line = line.replaceAll("—","-");
                    line = line.replaceAll(/[A-Za-z0-9]+(?:[\s-][A-Za-z0-9]+)*:/g,""); // Remove Source of speech code
                    line = line.replaceAll(/([[A-Za-z\s-,]+]|\([A-Za-z\s-,]+\))/g, "") // Remove all SDH codes
                    line = line.replaceAll(/<\/?i>/g, "") // Remove Italic opening and closing tags
                    line = line.replaceAll(/{(b|i|u|s|)[01]}/g, "") // Remove ASS codes, Example {\b1}
                    line = line.replaceAll(/{an[1-8]}/g, "") // Remove ASS codes, Example {\an1}
                    line = line.replaceAll(/J'|j'|J“|j“|J"|j"/g, '♪');
                    line = line.replaceAll(/[^A-Za-z0-9.,…?!:’'"()\[\]♪$£€+/\-×÷=@&#%áéíóúàèìòùäëïöü\s]/g, ''); // Only keep defined chars
                    line = line.replaceAll("♪♪","♪");
                    line = line.trim();
                    line = line.replaceAll(/\s+/g, ' '); // Replace all whitespaces to a single whitespace
                    if (line === "-") line = "";
                    if (line.charAt(0) === "-" && line.charAt(1) !== " ") line = `- ${line.substring(1)}`
                    if (line === "♪") line = "";
                    return line;
                }).filter(caption => caption);

                if (debugModeEnabled){
                    sequenceCaptions.forEach((sequenceCaption, index) => {
                        const beforeCaption = sequenceCaption[0];
                        const afterCaption = filteredSequenceCaptions[index] ?? "";
                        if (beforeCaption !== afterCaption){
                            console.info(beforeCaption, "|", afterCaption);
                        }
                    });
                }
                if (filteredSequenceCaptions.length > 0){
                    sequences.push([
                        sequenceTiming,
                        filteredSequenceCaptions
                    ]);
                }
            }
            [sequenceNumberFound, sequenceTiming, sequenceCaptions] = [false, "", []];
        }
    });

    const newFileSequences = []
    sequences.forEach((sequence, index) => {
        if (sequence[1])
            newFileSequences.push(`${index + 1}\n${sequence[0]}\n${sequence[1].join("\n")}\n\n`);
    })
    fs.writeFileSync(newFilePath, newFileSequences.join(""));
    console.info(`Subtitle file rewritten successfully to: ${newFilePath}`)
}

